@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATMRequestVerification a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:requestsVerificationOf ;
        owl:someValuesFrom atm:Card
    ] .

atm:Card a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasSerialNumber ;
        owl:someValuesFrom xsd:string
    ] ,
    [
        a owl:Restriction ;
        owl:onProperty atm:hasPassword ;
        owl:someValuesFrom xsd:string
    ] .

atm:BankComputer a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:checks ;
        owl:someValuesFrom atm:BankCode
    ] .

atm:BankCode a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:isValid ;
        owl:someValuesFrom xsd:boolean
    ] .
